import React from 'react';

class BlankList extends React.Component {
  render() {
    return (
      <div className="content">
        <div className="inner-content" id="list">
          <div className="list">
            <div>
              <div id="current_bus">
                <p id="current_bus_title">6613</p>
                <p id="current_bus_message"></p>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default BlankList;
